import "../Css/SearchBar.css";
const SearchBar = () =>{
    return(
        <>
        <div className="navbar-searchbar">
            <button type="button" className="search_icon">
                <li className=""/>
            </button>
            <input class="search_input" type="text" name="" placeholder="Search..."/>
        </div>
        </>
    )
};
export default SearchBar;
